Randy Cunningham: 9th Grade Ninja - Season 1 - Episode 1
--------------------------------------------------------

Randy Cunningham?! The kid spacing out in Algebra Class right now?
He's the NINJA?! Yep. That dude pulling straight Cs is the only
thing standing between Norrisville High School and an evil sorcerer
imprisoned deep beneath the school. He is the latest hero in a long
line of fearless fighters protecting the students from an impending
apocalypse. That is his duty. These are his adventures.
This is the legend of... Randy Cunningham: 9th Grade Ninja!

Produced by Disney Television Animation and Titmouse Inc.

Animated by Boulder Media.

